import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialScreenshot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialScreenshot });
    screenshots.push(initialScreenshot);

    // Wait for the price filter section using its heading text (robust to structure changes)
    await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // Use the label text to find the price filter container, then find inputs within
    const priceFilter = await page.$('//div[contains(@class, "price-filter") and .//h4[contains(text(), "Price Range")]]');
    if (!priceFilter) throw new Error('Price filter section not found');

    // Find the min and max price inputs using their placeholder attributes (different strategy)
    const minInput = await priceFilter.$('input[placeholder="Min"]');
    const maxInput = await priceFilter.$('input[placeholder="Max"]');
    if (!minInput || !maxInput) throw new Error('Price range inputs not found');

    // Clear and enter new values (e.g., $100 to $500)
    await minInput.click({ clickCount: 3 });
    await minInput.fill('100');
    await maxInput.click({ clickCount: 3 });
    await maxInput.fill('500');

    // Take screenshot after entering values
    const afterInputScreenshot = path.join(screenshotsDir, 'step_2_price_entered.png');
    await page.screenshot({ path: afterInputScreenshot });
    screenshots.push(afterInputScreenshot);

    // Find and click the "Apply" button using its visible text (not just class)
    const applyButton = await priceFilter.$('//button[contains(., "Apply")]');
    if (!applyButton) throw new Error('Apply filter button not found');
    await applyButton.click();

    // Wait for notification of filter applied (by text content)
    await page.waitForSelector('text=Applied price filter', { timeout: 4000 });

    // Wait for the products grid/list to update (wait for at least one product with price in range)
    // We'll look for a product price element with value between 100 and 500
    await page.waitForFunction(() => {
      const priceEls = Array.from(document.querySelectorAll('.product-price'));
      return priceEls.some(el => {
        const match = el.textContent.match(/\$([\d,]+\.\d{2})/);
        if (!match) return false;
        const price = parseFloat(match[1].replace(/,/g, ''));
        return price >= 100 && price <= 500;
      });
    }, { timeout: 5000 });

    // Take screenshot after filter applied
    const afterApplyScreenshot = path.join(screenshotsDir, 'step_3_filter_applied.png');
    await page.screenshot({ path: afterApplyScreenshot });
    screenshots.push(afterApplyScreenshot);

    // Extract all visible product titles and their prices in the filtered grid/list
    const extractedData = await page.evaluate(() => {
      const products = [];
      document.querySelectorAll('.product-card, .product-card-list').forEach(card => {
        const titleEl = card.querySelector('.product-title');
        const priceEl = card.querySelector('.product-price');
        if (titleEl && priceEl) {
          const priceMatch = priceEl.textContent.match(/\$([\d,]+\.\d{2})/);
          const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
          products.push({
            title: titleEl.textContent.trim(),
            price
          });
        }
      });
      return products;
    });

    // Verify all extracted prices are within the filter range
    const allWithinRange = extractedData.every(p => p.price >= 100 && p.price <= 500);

    return {
      success: allWithinRange,
      action: "Applied price range filter ($100 - $500) and verified filtered product prices",
      extractedData: {
        filteredProducts: extractedData,
        allWithinRange
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
